Information
------------------------------

How It's Made Dream Cars: Series 2
Join the legendary 'How It's Made' crew as they immerse themselves in automobile heaven, and discover how incredible machines are designed and created. From a Bugatti.Veyron to the Pagani.Huayra, from a Caterham.Seven to a Chevrolet.Corvette.Stingray, the team travel around the world to visit the birthplaces of a host of dream cars. Each half hour episode will reveal the cars' inner workings and gorgeous exteriors, which is enhanced with unprecedented access to the factories and test labs that are integral to their conception and creation.

